export default function Navbar() {
    return (
        <body id="Border">

            <nav id="container">
                <img id="image"></img>
                <li id="item">
                    <button type="button" class="links">
                        Sign In
                    </button>
                    <button type="button" class="links">
                        Register
                    </button>
                </li>

            </nav>
        </body>


    );
}

export  function Content() {
    return (
        <body>Nothing</body>
    );
}
